INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (2, 8, "人助けが大好き！　前向き格闘娘", 27, "トゥインクルウィッシュ", "ヒヨリ", "A", "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", 44, 16, 100101, "東山奈央", "人助け、応援", "獣人族", 155, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (2, 4, "戦闘のサポートが得意な、心優しい少女", 5, "トゥインクルウィッシュ", "ユイ", "O", "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", 47, 17, 100201, "種田梨沙", "料理、人間観察", "ヒューマン", 158, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (2, 1, "クールで何事にも真っ直ぐな剣士", 12, "トゥインクルウィッシュ", "レイ", "B", "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", 46, 18, 100301, "早見沙織", "読書、乗馬、お茶", "魔族", 163, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, 8, "探検好きのイタズラっ子", 10, "リトルリリカル", "ミソギ", "O", "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", 27, 9, 100401, "諸星すみれ", "いたずら、探検", "ヒューマン", 128, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 11, "ヒーローに憧れる騎士見習いの少女", 25, "王宮騎士団（NIGHTMARE）", "マツリ", "O", "？？？", 40, 12, 100501, "下田麻美", "ヒーローごっこ", "獣人族", 146, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 11, "甘え上手なみんなの人気者", 22, "悪魔偽王国軍（ディアボロス）", "アカリ", "O", "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", 42, 13, 100601, "浅倉杏美", "サックス", "魔族", 150, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 1, "プリン大好きゴースト娘", 23, "悪魔偽王国軍（ディアボロス）", "ミヤコ", "B", "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", 32, 14, 100701, "雨宮天", "プリンを食べること", "魔族", 130, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (15, 10, "ボクは誰よりも美しい", 10, "ヴァイスフリューゲル　ランドソル支部", "ユキ", "AB", "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", 40, 14, 100801, "大空直美", "鏡で自分を見ること", "エルフ", 150, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (13, 7, "前世を信じる中二病患者、「疾風の冥姫」", 5, "トワイライトキャラバン", "アンナ", "A", "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", 45, 17, 100901, "髙野麻美", "小説執筆", "魔族", 159, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 9, "マホマホ王国のプリンセス", 22, "自警団（カォン）", "マホ", "O", "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", 42, 16, 101001, "内田真礼", "空想、ぬいぐるみ集め", "獣人族", 155, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, 8, "人懐っこくてマシンガントークな妹系少女", 25, "ラビリンス", "リノ", "A", "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", 44, 15, 101101, "阿澄佳奈", "お裁縫", "ヒューマン", 156, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 12, "みんなのために超能力を使う眠り姫", 24, "フォレスティエ", "ハツネ", "A", "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", 46, 17, 101201, "大橋彩香", "妹と遊ぶこと、二度寝、昼寝、早寝", "エルフ", 156, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (13, 8, "オタク全開な魔法少女", 21, "トワイライトキャラバン", "ナナカ", "O", "", 55, 18, 101301, "佳村はるか", "読書、魔法", "魔族", 166, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 11, "頭脳明晰な美少女名探偵", 3, "自警団（カォン）", "カスミ", "AB", "test", 41, 15, 101401, "水瀬いのり", "読書、推理", "獣人族", 152, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 9, "母性溢れる優しいみんなの「ミサト先生」", 5, "フォレスティエ", "ミサト", "O", "test", 54, 21, 101501, "國府田マリ子", "絵本作り", "エルフ", 165, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (14, 4, "天真爛漫で人気者のカリスマモデル", 10, "ルーセント学院", "スズナ", "O", "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", 48, 18, 101601, "上坂すみれ", "ファッション", "魔族", 167, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 7, "いつでも「なんくるないさ～」な天然娘", 7, "自警団（カォン）", "カオリ", "A", "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", 53, 19, 101701, "高森奈津美", "踊り、空手", "獣人族", 158, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (14, 8, "多くの男性を魅了する無垢な女教師", 14, "ルーセント学院", "イオ", "B", "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", 52, 23, 101801, "伊藤静", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", "魔族", 162, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, 4, "お歌もにんじんも、ウサギさんも大好き♪", 3, "リトルリリカル", "ミミ", "O", "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", 21, 10, 102001, "日高里菜", "かわいいもの集め", "獣人族", 117, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 6, "泣き虫で臆病な守ってあげたい女の子", 9, "サレンディア救護院", "クルミ", "B", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 40, 12, 102101, "植田佳奈", "観劇、おままごと", "ヒューマン", 150, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 11, "人見知りであまのじゃくな女の子", 22, "悪魔偽王国軍（ディアボロス）", "ヨリ", "O", "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", 40, 13, 102201, "原紗友里", "ゲーム全般", "魔族", 150, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 5, "ぷうきちといつも一緒！", 10, "サレンディア救護院", "アヤネ", "B", "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", 38, 14, 102301, "芹澤優", "屋内でできる遊び", "ヒューマン", 148, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 12, "お嬢さまのためにがんばるドジっ娘メイド", 12, "サレンディア救護院", "スズメ", "O", "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", 43, 15, 102501, "悠木碧", "ご奉仕", "ヒューマン", 154, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 1, "遊びと睡眠が何より大事なぐうたら娘", 1, "牧場（エリザベスパーク）", "リン", "B", "test", 42, 17, 102601, "小岩井ことり", "あんパン", "獣人族", 144, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (13, 7, "運命の相手に一途すぎる乙女", 30, "トワイライトキャラバン", "エリコ", "B", "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", 43, 16, 102701, "橋本ちなみ", "実験、裁縫、料理", "魔族", 154, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 10, "救護院を経営する優しい庶民派お嬢様", 4, "サレンディア救護院", "サレン", "A", "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", 43, 17, 102801, "堀江由衣", "経営、お茶会", "エルフ", 156, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 1, "歌って踊れる大人気アイドル", 24, "カルミナ", "ノゾミ", "B", "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", 40, 17, 102901, "日笠陽子", "舞台鑑賞、ダンス", "ヒューマン", 157, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (15, 8, "トーゴクの神秘、オシエテクダサイ！", 31, "ヴァイスフリューゲル　ランドソル支部", "ニノン", "O", "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", 51, 16, 103001, "佐藤聡美", "忍法開発", "ヒューマン", 163, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 12, "占いが得意な霊能少女", 22, "悪魔偽王国軍（ディアボロス）", "シノブ", "AB", "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", 42, 18, 103101, "大坪由佳", "占い", "魔族", 157, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 3, "一人前の商人を目指すパワフルお嬢様", 12, "メルクリウス財団", "アキノ", "AB", "この私とともにいる限り、\nお金に不自由はさせませんわ！", 45, 18, 103201, "松嵜麗", "慈善事業", "ヒューマン", 157, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 3, "みんなを笑顔にするお笑い牧場主", 3, "牧場（エリザベスパーク）", "マヒル", "B", "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", 35, 20, 103301, "新田恵海", "漫才", "ヒューマン", 142, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 3, "純情でほっとけない大人の女性", 16, "メルクリウス財団", "ユカリ", "A", "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", 55, 22, 103401, "今井麻美", "ウインドーショッピング", "エルフ", 164, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (5, 2, "礼儀正しくしっかり者のちびっ子優等生", 2, "リトルリリカル", "キョウカ", "A", "test", 21, 8, 103601, "小倉唯", "お勉強", "エルフ", 118, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 8, "義理堅くてからかい好きな剣術少女", 11, "王宮騎士団（NIGHTMARE）", "トモ", "A", "test", 43, 13, 103701, "茅原実里", "剣術、年長者をからかう", "ヒューマン", 149, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (11, 11, "読書が趣味の病弱少女", 3, "牧場（エリザベスパーク）", "シオリ", "A", "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", 40, 14, 103801, "小清水亜美", "読書、お散歩", "獣人族", 153, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (6, 6, "「友達」に憧れる、エルフの森の女の子", 6, "フォレスティエ", "アオイ", "AB", "友達ができるその日まで…\nBB団で\nトレーニングですっ！", 44, 13, 104001, "花澤香菜", "友達作りのイメトレ", "エルフ", 158, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 6, "人々を守るために歌う、唱喚士の少女", 3, "カルミナ", "チカ", "O", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 46, 17, 104201, "福原綾香", "各種楽器", "ヒューマン", 163, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (10, 8, "男勝りで情に厚いワイルド娘", 9, "自警団（カォン）", "マコト", "O", "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", 54, 17, 104301, "小松未可子", "お菓子作り", "獣人族", 168, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (7, 5, "かつては夜を支配した最強の吸血鬼", 5, "悪魔偽王国軍（ディアボロス）", "イリヤ", "A", "test", 50, "??", 104401, "丹下桜", "世界征服", "魔族", 172, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (15, 11, "妄想大好き！　ほんとは照れ屋な女の子", 19, "ヴァイスフリューゲル　ランドソル支部", "クウカ", "AB", "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", 49, 18, 104501, "長妻樹里", "小説を読むこと", "ヒューマン", 157, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 3, "弱きを助け強きをくじく猫娘", 1, "メルクリウス財団", "タマキ", "AB", "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", 48, 18, 104601, "沼倉愛美", "猫とたわむれること", "獣人族", 158, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (8, 10, "素顔を見せない冷静沈着な女性騎士", 25, "王宮騎士団（NIGHTMARE）", "ジュン", "A", "？？？", 50, 25, 104701, "川澄綾子", "格闘技、湯浴み", "ヒューマン", 171, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (12, 11, "仕事も私事も効率優先な傭兵少女", 11, "メルクリウス財団", "ミフユ", "O", "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", 49, 20, 104801, "田所あずさ", "傭兵などのアルバイト", "ヒューマン", 163, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (3, 10, "お姉ちゃんがお世話してあげるからねっ！", 24, "ラビリンス", "シズル", "O", "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", 54, 18, 104901, "生天目仁美", "家事全般", "ヒューマン", 168, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (14, 1, "ちょっとおませな恋に恋する女の子", 3, "ルーセント学院", "ミサキ", "A", "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", 22, 11, 105001, "久野美咲", "ファッション誌鑑賞、コスメ集め", "魔族", 120, 0);
