INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (4, 6, "人々を守るために歌う、唱喚士の少女", 3, "カルミナ", "チカ（クリスマス）", "O", "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", 46, 17, 108401, "福原綾香", "各種楽器", "ヒューマン", 163, 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (9, 6, "泣き虫で臆病な守ってあげたい女の子", 9, "サレンディア救護院", "クルミ（クリスマス）", "B", "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", 40, 12, 108501, "植田佳奈", "観劇、おままごと", "ヒューマン", 150, 0);
